import React , {useState} from "react";
import { Col, Container, Row } from "react-bootstrap";

const NewMain2 = () => {
    const [nameValue, setNameValue] = useState("");
  // Name Value function
  function NameValueFun(e) {
    setNameValue(e.target.value);
  }
    return(
        <>
        {/* Main Div */}
        <Container className="main-style mt-5 mb-5">
             {/* Start coDe */}
             <Row>
                 {/* 1st Column */}
                 <Col xs={6}>
                     <Row className="mt-4">
                         {/* Personal Detail column  */}
                         <Col><Row>
              <label>
                <input
                  type="text"
                  placeholder="Full Name"
                  className="new-input"
                  onChange={NameValueFun}
                />
              </label>
            </Row></Col>
                         {/* Professional Detail */}
                         <Col><Row>
              <label>
                <input
                  type="text"
                  placeholder="Full Name"
                  className="new-input"
                  onChange={NameValueFun}
                />
              </label>
            </Row></Col>
                     </Row>
                 </Col>
                 {/* 2d Column*/}
                 <Col xs={6} className="mt-5"> {nameValue}</Col>
             </Row>

        </Container>
        </>
    )
}
export default NewMain2
